require 'helpers/spec_helper'
require 'data/RSOLanding.aspx'

require __FILE__.sub('/spec/lib/', '/lib/').sub(/_spec\.rb$/, '.rb')

Requests ||= RSA::API::V1::Requests

class ExposedLeague < Requests::League
  public

  attr_accessor :response
end

describe ExposedLeague do
  let(:request) {
    Rack::Request.new(Rack::MockRequest.env_for)
  }
  let(:instance) { described_class.new(request) }
  let(:response) {
    Typhoeus::Response.new({
      code: 200,
      return_code: :ok,
      body: RSO_LANDING_DATA
    })
  }

  context '#fetch!' do
    let(:week) { 1.to_s } # idk...

    before do
      Typhoeus.expects(:get).with do |url|
        url.include? "#{ described_class::RSO_PATH }"
      end
      .returns(response)

      instance.list
    end

    it 'has the response' do
      expect(instance.response).not_to be_nil
    end
  end

  context '#as_models' do
    let(:model) { instance.as_models.first }
    let(:expected__EVENTTARGET) { %q(ctl00$ctl00$ctl00$cphContent$cphHeaderNav$ctl00$leagueNav$ctl01$lnkLeagueName) }
    let(:expected__VIEWSTATE) { %q() }
    let(:expected_league_id) { %q(<test value>) } # modified the markup to set this value
    let(:expected_name) { 'Dynasty Reboot' }
    let(:expected_team_name) { '@pnewell4' }

    before do
      instance.response = response
    end

    it 'extracts "event target"' do
      expect(model.ms_unnecessary_crap__EVENTTARGET)
        .to eq(expected__EVENTTARGET)
    end

    it 'extracts "view state"' do
      expect(model.ms_unnecessary_crap__VIEWSTATE)
        .to eq(expected__VIEWSTATE)
    end

    it 'extracts "league id"' do
      expect(model.league_id)
        .to eq(expected_league_id)
    end

    it 'extracts "league id"' do
      expect(model.name)
        .to eq(expected_name)
    end

    it 'extracts "league id"' do
      expect(model.team_name)
        .to eq(expected_team_name)
    end
  end
end
